import '../styles/projtemplate.css';
import projects from '../db.json'
import Project from './Project'

const projectPages = {
    1: DatatonismPage,
    2: SpirPage,
    3: SteammindPage,
    4: SfbsPage,
};

export default class Test extends Component {
    render(){
        const { id, match } = this.props;
        const Page = projectPages[match.params.id];
        console.log(`buswanker: ${Page}`);
        return(
            <Fragment>
                <Page />
            </Fragment>
        )
    }
}

